CREATE TABLE work (
	id INTEGER NOT NULL, 
	start DATETIME, 
	end DATETIME, 
	person INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE washing (
	id INTEGER NOT NULL, 
	start DATETIME, 
	end DATETIME, 
	person INTEGER, hostel INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE violation (
	id INTEGER NOT NULL, 
	description VARCHAR(255), 
	person INTEGER, date DATE, 
	PRIMARY KEY (id)
);
CREATE TABLE video_slider (
	id INTEGER NOT NULL, 
	date_added DATETIME, 
	url VARCHAR(255), 
	active BOOLEAN, 
	PRIMARY KEY (id), 
	CHECK (active IN (0, 1))
);
CREATE TABLE user (
	id INTEGER NOT NULL, 
	login VARCHAR(80), 
	email VARCHAR(120), 
	password VARCHAR(64), 
	person_id INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE temperature (
	id INTEGER NOT NULL, 
	date DATE, 
	temperature FLOAT, 
	hostel_id INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE statistics (
	id INTEGER NOT NULL, 
	date DATE, 
	places_all INTEGER, 
	places2 INTEGER, 
	places3 INTEGER, 
	places4 INTEGER, 
	free_1 INTEGER, 
	free_2 INTEGER, 
	free_3 INTEGER, 
	free_4 INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE room_free (
	id INTEGER NOT NULL, 
	places INTEGER, 
	room_id INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE room (
	id INTEGER NOT NULL, 
	room_number INTEGER, 
	numbers_of_person INTEGER, 
	floor INTEGER, 
	block_id INTEGER, hostel_id INTEGER, note VARCHAR(30), service BOOLEAN, windows BOOLEAN, econom BOOLEAN, 
	PRIMARY KEY (id)
);
CREATE TABLE roles_users (
	user_id INTEGER, 
	role_id INTEGER
);
CREATE TABLE role (
	id INTEGER NOT NULL, 
	name VARCHAR(80), 
	description VARCHAR(255), 
	PRIMARY KEY (id)
);
CREATE TABLE repair (
	id INTEGER NOT NULL, 
	description VARCHAR(255), 
	tag VARCHAR(255), 
	fix BOOLEAN, 
	person INTEGER, close_date DATE, open_date DATE, 
	PRIMARY KEY (id), 
	CHECK (fix IN (0, 1))
);
CREATE TABLE register_student (
	id INTEGER NOT NULL, 
	register_id INTEGER, 
	father VARCHAR(255), 
	father_work VARCHAR(255), 
	mother VARCHAR(255), 
	mother_work VARCHAR(255), 
	brothers_sisters VARCHAR(255), 
	parents_street VARCHAR(255), 
	parents_home VARCHAR(255), 
	parents_apartment VARCHAR(255), 
	parents_settlement VARCHAR(255), 
	parents_district VARCHAR(255), 
	parents_region VARCHAR(255), 
	parents_index INTEGER, 
	parents_landline_phone VARCHAR(255), 
	parents_mobile_phone VARCHAR(255), 
	PRIMARY KEY (id)
);
CREATE TABLE register_main (
	id INTEGER NOT NULL, 
	room_type VARCHAR(25), 
	reason VARCHAR(50), 
	first_name VARCHAR(50), 
	last_name VARCHAR(50), 
	middle_name VARCHAR(50), 
	birthday DATE, 
	department VARCHAR(50), 
	specialty VARCHAR(50), 
	`group` VARCHAR(50), 
	`work` VARCHAR(50), 
	s_passport VARCHAR(50), 
	n_passport VARCHAR(50), 
	d_passport DATE, 
	k_passport VARCHAR(50), 
	phone_number VARCHAR(50), 
	lived_hostel VARCHAR(50), 
	lived_room VARCHAR(50), form_of_education VARCHAR(50), 
	PRIMARY KEY (id)
);
CREATE TABLE register_family (
	id INTEGER NOT NULL, 
	register_id INTEGER, children_live BOOLEAN, childrens VARCHAR(255), husband_wife VARCHAR(255), husband_wife_birthday DATE, husband_wife_d_passport DATE, husband_wife_form_of_education VARCHAR(255), husband_wife_k_passport VARCHAR(255), husband_wife_lived VARCHAR(255), husband_wife_lived_hostel VARCHAR(255), husband_wife_lived_room VARCHAR(255), husband_wife_n_passport INTEGER, husband_wife_s_passport VARCHAR(255), husband_wife_work VARCHAR(255), 
	PRIMARY KEY (id)
);
CREATE TABLE register (
	id INTEGER NOT NULL, 
	first_name VARCHAR(255), 
	last_name VARCHAR(255), 
	middle_name VARCHAR(255), 
	department VARCHAR(50), 
	`group` INTEGER, 
	form_of_education VARCHAR(255), 
	room_id INTEGER, 
	birthday VARCHAR(255), 
	passport VARCHAR(255), 
	parents VARCHAR(255), 
	`index` INTEGER, 
	region VARCHAR(255), 
	district VARCHAR(255), 
	settlement VARCHAR(255), 
	street VARCHAR(255), 
	phone_number_parent VARCHAR(255), 
	phone_number VARCHAR(255), 
	note VARCHAR(255), email VARCHAR(255), 
	PRIMARY KEY (id)
);
CREATE TABLE post (
	id INTEGER NOT NULL, 
	title VARCHAR(100), 
	previewtext VARCHAR(100), 
	body TEXT, 
	timestamp DATETIME, 
	path VARCHAR(255), 
	PRIMARY KEY (id)
);
