CREATE TABLE photo (
	id INTEGER NOT NULL, 
	description VARCHAR(255), 
	path VARCHAR(255), timestamp DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE person_old (
	id INTEGER NOT NULL, 
	start_date DATE, 
	end_date DATE, 
	last_name VARCHAR(255), 
	first_name VARCHAR(255), 
	middle_name VARCHAR(255), 
	department VARCHAR(50), 
	`group` INTEGER, 
	form_of_education VARCHAR(255), 
	hostel_id INTEGER, 
	room_id INTEGER, 
	birthday VARCHAR(255), 
	passport VARCHAR(255), 
	parents VARCHAR(255), 
	`index` INTEGER, 
	region VARCHAR(255), 
	district VARCHAR(255), 
	settlement VARCHAR(255), 
	street VARCHAR(255), 
	phone_number_parent VARCHAR(255), 
	phone_number VARCHAR(255), 
	note VARCHAR(255), 
	email VARCHAR(255), 
	PRIMARY KEY (id)
);
CREATE TABLE person (
	id INTEGER NOT NULL, 
	first_name VARCHAR(255), 
	last_name VARCHAR(255), 
	middle_name VARCHAR(255), 
	department VARCHAR(50), 
	`group` INTEGER, 
	form_of_education VARCHAR(255), 
	hostel_id INTEGER, 
	room_id INTEGER, 
	birthday VARCHAR(255), 
	passport VARCHAR(255), 
	parents VARCHAR(255), 
	`index` INTEGER, 
	region VARCHAR(255), 
	district VARCHAR(255), 
	settlement VARCHAR(255), 
	street VARCHAR(255), 
	phone_number_parent VARCHAR(255), 
	phone_number VARCHAR(255), 
	note VARCHAR(255), 
	invite VARCHAR(255), 
	room INTEGER, email VARCHAR(255), start_date DATE, 
	PRIMARY KEY (id), 
	FOREIGN KEY(room) REFERENCES room (id)
);
CREATE TABLE payment (
	id INTEGER NOT NULL, 
	date DATE, 
	person INTEGER, price FLOAT, 
	PRIMARY KEY (id)
);
CREATE TABLE news__slider (
	id INTEGER NOT NULL, 
	title VARCHAR(255), 
	previewtext VARCHAR(255), 
	body TEXT, 
	timestamp DATETIME, 
	path VARCHAR(255), 
	PRIMARY KEY (id)
);
