CREATE TABLE migrate_version (
	repository_id VARCHAR(250) NOT NULL, 
	repository_path TEXT, 
	version INTEGER, 
	PRIMARY KEY (repository_id)
);
CREATE TABLE logger (
	id INTEGER NOT NULL, 
	url VARCHAR(255), 
	remote_addr VARCHAR(255), 
	method VARCHAR(255), 
	user_agent VARCHAR(255), 
	datetime DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE hostel (
	id INTEGER NOT NULL, 
	number INTEGER, address VARCHAR(140), 
	PRIMARY KEY (id)
);
CREATE TABLE block (
	id INTEGER NOT NULL, 
	hostel_id INTEGER, 
	number VARCHAR(50), 
	hot_water BOOLEAN, 
	floor INTEGER, 
	sex VARCHAR(2), 
	PRIMARY KEY (id), 
	FOREIGN KEY(hostel_id) REFERENCES hostel (id), 
	CHECK (hot_water IN (0, 1))
);
